import {Drawer, Menu} from 'antd';

const Navbar = () =>{
    return(
        <div>
            <AppMenu/>
            <Drawer open closable={false}>
                <AppMenu isInline />
            </Drawer>
        </div>
    );
};

export default Navbar;

function AppMenu({isInline=false}){
    return(
        <Menu 
            style={{ height: 100, paddingInline: 50, lineHeight: '64px', top: 50}}
            mode={ isInline? "inline" :'horizontal'} 
            items={[
                {
                    label: 'Home',
                    key:'home',
                }, {
                    label: 'Contact us',
                    key:'contact',
                }, {
                    label: 'About us',
                    key:'about',
                }, {
                    label: 'Login',
                    key:'login',
                }

            ]}
            >
            </Menu>
    );
}
